  &quot;business_id&quot;: &quot;XQfwVwDr-v0ZS3_CbbE5Xw&quot;,
  &quot;stars&quot;: 3,
  &quot;useful&quot;: 0,
  &quot;funny&quot;: 0,
  &quot;cool&quot;: 0,
  &quot;text&quot;: &quot;If you decide to eat here, ...&quot;,
  &quot;date&quot;: &quot;2018-07-07 22:09:11&quot;
}
</code></pre>
<p>collection.business:</p>
<pre><code>{
