  &quot;address&quot;: &quot;1460 Bethlehem Pike&quot;,
  &quot;city&quot;: &quot;North Wales&quot;,
  &quot;state&quot;: &quot;PA&quot;,
  &quot;postal_code&quot;: &quot;19454&quot;,
