  &quot;review_count&quot;: 169,
  &quot;is_open&quot;: 1,
  &quot;attributes&quot;: Object
  &quot;categories&quot;: &quot;Restaurants, Breakfast &amp; Brunch, Food&quot;,
  &quot;hours&quot;: Object
}
</code></pre>
<p>I am a beginner at mongodb, the only pipeline I have some result is this.</p>
<pre><code>review.aggregate([{
 $match: {
  user_id: {
