    1: Object
        latitude: 39
        longitude: -119
    2: Object
        latitude: 39
        longitude: -119
    3: Object
        latitude: 39
        longitude: -119
    4: Object
        latitude: 39
        longitude: -119
places: 5
</code></pre>
<p>After that i process the result in python. Is there someway to do it from the pipeline immediately
and have the result something like this (and limited to top 3)</p>
<pre><code>_id: &quot;xoZvMJPDW6Q9pDAXI0e_Ww&quot;
top_places: Array
    0: Object
